import styles from "./Footer.module.css";
import FooterMenu from "./FooterMenu";

function Footer() {
  return (
    <div className={styles.fdiv}>
      <div className={styles.footer}>
        <img
          src="https://jagdishfarshan.com/Content/img/home/logo.png"
          alt="Jagdish"
        />

        <FooterMenu />
      </div>
    </div>
  );
}

export default Footer;
